# region: User & Alpha


class User(SQLModel, table=True, extend_existing=True):
    """User 用户

    Relations
    ---------
    alphas : list[Alpha]
        用户名下的 Regular Alpha
    superalphas : list[SuperAlpha]
        用户名下的 Super Alpha
    """

    id: str = Field(primary_key=True)

    alphas: list["Alpha"] = Relationship(back_populates="user")
    superalphas: list["SuperAlpha"] = Relationship(back_populates="user")

    update_time: datetime | None = Field(default_factory=datetime.now, nullable=True)

    username: str = Field(unique=True)
    password: str
    token_expiry: float
    permissions: list[str] = Field(
        default_factory=list, sa_column=sqlalchemy.Column(JSON)
    )
    cookie: str | None = None

    @classmethod
    def build(
        cls,
        record: dict[str, Any],
        username: str,
        password: str,
        cookie: str | None = None,
    ) -> Self:
        user_id: str = record["user"]["id"]
        token_expiry: float = record["token"]["expiry"]
        permissions: list[str] = record["permissions"]

        return cls(
            id=user_id,
            username=username,
            password=password,
            token_expiry=token_expiry,
            permissions=permissions,
            cookie=cookie,
            update_time=datetime.now(),
        )

    def update_cookie(self, cookie: str, token_expiry: float | None = None) -> Self:
        self.cookie = cookie
        if token_expiry is not None:
            self.token_expiry = token_expiry
        self.update_time = datetime.now()
        return self


class Alpha(SQLModel, table=True, extend_existing=True):
    """Regular Alpha

    Relations
    ---------
    user : User
        Alpha 所属的用户

    Payload Descp
    -------------
    category : 类别
    description : 描述
    category : 类别
    color : 颜色
    name : 名字
    tags : 标签
    hidden : 隐藏

    Payload Simulation
    ------------------
    type : REGULAR
    settings.
        instrumentType : 标的类型
        region : 地区
        universe : 标的范围
        delay : 0/1
        decay : 衰减
        neutralization : 中性化
        truncation : 截断
        pasteurization : past-eurization
        unitHandling : 单位处理
        maxTrade : 是否开启 MaxTrade
        language : 语法
        visualization: 可视化
        startDate : 回测开始时间
        endDate : 回测结束时间
    regular.code : expr

    Raw
    ---
    raw : dict
        获取因子时的原始记录
    checkable : bool
        是否可以提交检查, 即当前没有失败的检查项.
        为了降低负载, 一般只有可以提交检查的因子会计算自相关性.
    ppa_available: bool
        是否符合 PowerPoolAlpha, 对于已提交的因子, 查看标签是否有
        `PowerPoolSelected`, 对于未提交的因子, 查看检查项是否有
        `POWER_POOL_CORRELATION`

    PnL
    ---
    pnl : dict
        raw pnl data.

    Check
    -----
    check_raw : dict
        检查因子接口返回的原始数据
    submittable : bool
        检查 check_raw.is.checks 中是否不含 FAIL 和 PENDING 项.

    ProdCorr
    --------
    prod_raw : dict
        生产相关性计算原始数据
    prod : float
        生产相关性最大值

    Performance
    -----------
    perf_raw : dict
        因子表现对比原始数据
    """

    id: str = Field(primary_key=True)

    user_id: str = Field(foreign_key="user.id", index=True)
    user: User = Relationship(back_populates="alphas")

    update_time: datetime = Field(default_factory=datetime.now)

    status: str
    create_time: datetime
    expr: str
    grade: str | None = None
    stage: str

    instrument: str = "EQUITY"
    region: str
    universe: str
    decay: int = Field(ge=0)
    delay: int = Field(ge=0, le=1)
    neutralization: str
    truncation: float = Field(ge=0, le=1)
    pasteurization: str
    unit_handling: str
    max_trade: str
    language: str = "FASTEXPR"
    nan_handling: str
    start_date: str = START_DATE
    end_date: str = END_DATE
    visualization: bool = False

    name: str | None = None
    favorite: bool = False
    hidden: bool = False
    color: str | None = None
    category: str | None = None
    tags: list[str] = Field(default_factory=list, sa_column=sqlalchemy.Column(JSON))
    classifications: list[dict] = Field(
        default_factory=list, sa_column=sqlalchemy.Column(JSON)
    )
    description: str | None = None

    is_pnl: int
    is_booksize: int
    is_longcnt: int
    is_shortcnt: int
    is_turnover: float
    is_returns: float
    is_drawdown: float
    is_margin: float
    is_sharpe: float
    is_fitness: float

    prod: float | None = Field(default=None)

    checkable: bool
    ppa_available: bool
    submittable: bool | None = None

    pnl: dict | None = Field(default=None, sa_column=Column(JSON))
    raw: dict = Field(sa_column=Column(JSON))
    check_raw: dict | None = Field(default=None, sa_column=Column(JSON))
    prod_raw: dict | None = Field(default=None, sa_column=Column(JSON))
    perf_raw: dict | None = Field(default=None, sa_column=Column(JSON))

    @classmethod
    def build(cls, record: dict[str, Any]) -> Self:
        if record["type"] != "REGULAR":
            raise TypeError(
                f"Alpha.build 只支持 Regular Alpha, 传入的是 {record['type']}"
            )
        user_id: str = record["author"]
        status: str = record["status"]
        create_time: datetime = datetime.fromisoformat(record["dateCreated"])
        expr: str = record["regular"]["code"]
        grade: str | None = record["grade"]
        stage: str = record["stage"]

        instrument: str = record["settings"]["instrumentType"]
        region: str = record["settings"]["region"]
        universe: str = record["settings"]["universe"]
        delay: int = record["settings"]["delay"]
        decay: int = record["settings"]["decay"]
        neutralization: str = record["settings"]["neutralization"]
        truncation: float = record["settings"]["truncation"]
        pasteurization: str = record["settings"]["pasteurization"]
        unit_handling: str = record["settings"]["unitHandling"]
        max_trade: str = record["settings"]["maxTrade"]
        language: str = record["settings"]["language"]
        nan_handling: str = record["settings"]["nanHandling"]
        start_date: str = record["settings"]["startDate"]
        end_date: str = record["settings"]["endDate"]
        visualization: bool = record["settings"]["visualization"]

        name: str | None = record["name"]
        favorite: bool = record["favorite"]
        hidden: bool = record["hidden"]
        color: str | None = record["color"]
        category: str | None = record["category"]
        tags: list[str] = record["tags"]
        classifications: list[dict] = record["classifications"]
        description: str | None = record["regular"]["description"]

        is_pnl: int = record["is"]["pnl"]
        is_booksize: int = record["is"]["bookSize"]
        is_longcnt: int = record["is"]["longCount"]
        is_shortcnt: int = record["is"]["shortCount"]
        is_turnover: float = record["is"]["turnover"]
        is_returns: float = record["is"]["returns"]
        is_drawdown: float = record["is"]["drawdown"]
        is_margin: float = record["is"]["margin"]
        is_sharpe: float = record["is"]["sharpe"]
        is_fitness: float = record["is"]["fitness"] or 0

        checkable: bool = not bool(
            list(filter(lambda x: x["result"] == "FAIL", record["is"]["checks"]))
        )
        ppa_available: bool = ("PowerPoolSelected" in tags) or bool(
            list(
                filter(
                    lambda x: x["name"] == "POWER_POOL_CORRELATION",
                    record["is"]["checks"],
                )
            )
        )
        return cls(
            id=record["id"],
            user_id=user_id,
            status=status,
            create_time=create_time,
            expr=expr,
            grade=grade,
            stage=stage,
            instrument=instrument,
            region=region,
            universe=universe,
            delay=delay,
            decay=decay,
            neutralization=neutralization,
            truncation=truncation,
            pasteurization=pasteurization,
            unit_handling=unit_handling,
            max_trade=max_trade,
            language=language,
            nan_handling=nan_handling,
            start_date=start_date,
            end_date=end_date,
            visualization=visualization,
            name=name,
            favorite=favorite,
            hidden=hidden,
            color=color,
            category=category,
            tags=tags,
            classifications=classifications,
            description=description,
            is_pnl=is_pnl,
            is_booksize=is_booksize,
            is_longcnt=is_longcnt,
            is_shortcnt=is_shortcnt,
            is_turnover=is_turnover,
            is_returns=is_returns,
            is_drawdown=is_drawdown,
            is_margin=is_margin,
            is_sharpe=is_sharpe,
            is_fitness=is_fitness,
            checkable=checkable,
            ppa_available=ppa_available,
            raw=record,
        )

    def to_payload(
        self, mode: Literal["description", "simulation"] = "description"
    ) -> dict[str, Any]:
        match mode:
            case "description":
                return {
                    "category": self.category,
                    "regular": {"description": self.description},
                    "color": self.color,
                    "name": self.name,
                    "tags": self.tags,
                    "hidden": self.hidden,
                    "favorite": self.favorite,
                }
            case "simulation":
                return {
                    "type": "REGULAR",
                    "settings": {
                        "instrumentType": self.instrument,
                        "language": self.language,
                        "region": self.region,
                        "universe": self.universe,
                        "delay": self.delay,
                        "decay": self.decay,
                        "visualization": self.visualization,
                        "neutralization": self.neutralization,
                        "truncation": self.truncation,
                        "pasteurization": self.pasteurization,
                        "unitHandling": self.unit_handling,
                        "nanHandling": self.nan_handling,
                        "maxTrade": self.max_trade,
                    },
                    "regular": self.expr,
                }
            case _:
                raise ValueError(f"Alpha 不支持导出为 {mode}")

    def update_pnl(self, record: dict[str, Any]) -> Self:
        self.pnl = record
        self.update_time = datetime.now()
        return self

    def update_check(self, record: dict[str, Any]) -> Self:
        self.check_raw = record
        self.submittable = not bool(
            list(
                filter(
                    lambda x: x["result"] in ["FAIL", "PENDING"], record["is"]["checks"]
                )
            )
        )
        self.update_time = datetime.now()
        return self

    def update_performance(self, record: dict[str, Any]) -> Self:
        self.perf_raw = record
        self.update_time = datetime.now()
        return self

    def update_prodcorr(self, record: dict[str, Any]) -> Self:
        self.prod_raw = record
        self.prod = record["max"]
        self.update_time = datetime.now()
        return self

    def __repr__(self) -> str:
        _submittable = (
            "☐" if self.submittable is None else ("☑︎" if self.submittable else "☒")
        )
        r = (
            f"Alpha[{self.id}](\n"
            f"  region:\t{self.region}\n"
            f"  universe:\t{self.universe}\n"
            f"  delay:\t{self.delay}\n"
            f"  sharpe:\t{self.is_sharpe}\n"
            f"  fitness:\t{self.is_fitness}\n"
            f"  margin:\t{self.is_margin}\n"
            f"  grade:\t{self.grade}\n"
            f"  ppa:\t\t{'☑︎' if self.ppa_available else '☒'}\n"
            f"  checkable:\t{'☑︎' if self.checkable else '☒'}\n"
            f"  submittable:\t{_submittable}\n"
            f"  pnl:\t\t{'☑︎' if self.pnl is not None else '☒'}\n"
            f")"
        )
        return r

    def __str__(self) -> str:
        return self.__repr__()


