class AlphaSet(SQLModel, table=True, extend_existing=True):
    """AlphaSet 因子集

    在平台上搜索 AlphaSet 时可以拿到因子集, 通过对关键参数进行 Hashing
    来获取唯一的 Encode, 再利用 Encode 来检索过滤因子集, 跳过冗余搜索.

    满足以下条件的因子集已冻结:
    - 不包含描述区条件, name, tag, category, color
    - date_to 不为空
    - update_time <= date_to
    已冻结因子集可以直接取本地, 否则需要重新获取.
    """

    id: int | None = Field(default=None, primary_key=True)
    encode: str | None = Field(default=None, unique=True)
    update_time: datetime = Field(default_factory=datetime.now)

    alphas: list[str] = Field(sa_column=Column(JSON), default_factory=list)

    alpha_type: str | None = None

    region: str | None = None
    universe: str | None = None
    delay: int | None = Field(ge=0, le=1, default=None)
    status: str | None = None
    date_from: datetime | None = None
    date_to: datetime | None = None
    sharpe: float | None = None
    fitness: float | None = None
    tag: str | None = None
    name: str | None = None
    category: str | None = None
    color: str | None = None

    def hashing(self) -> str:
        fields = [
            self.region,
            self.universe,
            self.delay,
            self.status,
            self.alpha_type,
            self.date_from,
            self.date_to,
            self.sharpe,
            self.fitness,
            self.tag,
            self.name,
            self.category,
            self.color,
        ]
        return hashing_fields(fields=fields)

    @property
    def frozen(self) -> bool:
        if (
            self.tag is not None
            or self.name is not None
            or self.category is not None
            or self.color is not None
        ):
            _frozen = False
        elif self.date_to is None:
            _frozen = False
        elif self.update_time < self.date_to:
            _frozen = False
        else:
            _frozen = True

        return _frozen

    def to_params(self) -> dict:
        params: dict[str, Any] = {
            "type": self.alpha_type,
            "limit": 100,
            "order": "-is.fitness",
        }
        if self.date_from is not None:
            params["dateCreated>"] = format_dt(convert_tz(self.date_from))
        if self.date_to is not None:
            params["dateCreated<"] = format_dt(convert_tz(self.date_to))
        if self.status is not None:
            params["status"] = self.status

        # settings
        for setting, setting_s in zip(
            [self.delay, self.region, self.universe],
            ["delay", "region", "universe"],
        ):
            if setting is not None:
                params[f"settings.{setting_s}"] = setting

        # is
        for is_value, is_value_s in zip(
            [self.sharpe, self.fitness],
            ["sharpe", "fitness"],
        ):
            if is_value is not None:
                params[f"is.{is_value_s}>"] = is_value

        # info
        for info, info_s in zip(
            [self.tag, self.name, self.color, self.category],
            ["tag", "name", "color", "category"],
        ):
            if info is not None:
                params[info_s] = info

        return params


