# region: Simulation


class Simulation(SQLModel, table=True, extend_existing=True):
    """Simulation 回测

    类似 AlphaSet, 回测核心内容进行 Hashing, 避免冗余回测.
    区别在于回测是有明确实体的, 即使一模一样的回测在系统上也是可以执行的,
    会对应不同的 SimulationID.

    simid 是回测代码, 由于存在批量回测, 所以回测与 Alpha 并不是一一对应关系.
    """

    id: int | None = Field(default=None, primary_key=True)
    encode: str | None = Field(default=None)
    update_time: datetime = Field(default_factory=datetime.now)

    simid: str | None = Field(default=None)
    alpha_id: str = Field(foreign_key="alpha.id", default=None, nullable=False)

    expr: str

    instrument: str = "EQUITY"
    region: str
    universe: str
    decay: int = Field(ge=0, default=4)
    delay: int = Field(ge=0, le=1)
    neutralization: str = "NONE"
    truncation: float = Field(ge=0, le=1, default=0.08)
    pasteurization: str = "ON"
    unit_handling: str = "VERIFY"
    max_trade: str = "OFF"
    language: str = "FASTEXPR"
    nan_handling: str = "ON"
    visualization: bool = False

    name: str | None = None
    favorite: bool = False
    hidden: bool = False
    color: str | None = None
    category: str | None = None
    tags: list[str] = Field(default_factory=list, sa_column=sqlalchemy.Column(JSON))
    description: str | None = None

    def to_payload(
        self, mode: Literal["description", "simulation"] = "simulation"
    ) -> dict:
        match mode:
            case "simulation":
                return {
                    "type": "REGULAR",
                    "settings": {
                        "instrumentType": self.instrument,
                        "language": self.language,
                        "region": self.region,
                        "universe": self.universe,
                        "delay": self.delay,
                        "decay": self.decay,
                        "visualization": self.visualization,
                        "neutralization": self.neutralization,
                        "truncation": self.truncation,
                        "pasteurization": self.pasteurization,
                        "unitHandling": self.unit_handling,
                        "nanHandling": self.nan_handling,
                        "maxTrade": self.max_trade,
                    },
                    "regular": self.expr,
                }
            case "description":
                return {
                    "category": self.category,
                    "regular": {"description": self.description},
                    "color": self.color,
                    "name": self.name,
                    "tags": self.tags,
                    "hidden": self.hidden,
                    "favorite": self.favorite,
                }
            case _:
                raise ValueError(f"不支持的 Payload 模式: {mode}")

    def hashing(self) -> str:
        fields = [
            self.expr,
            self.region,
            self.universe,
            self.instrument,
            self.delay,
            self.decay,
            self.neutralization,
            self.truncation,
            self.pasteurization,
            self.unit_handling,
            self.nan_handling,
            self.max_trade,
            self.visualization,
            self.language,
        ]
        return hashing_fields(fields=fields)


@event.listens_for(Simulation, "before_insert")
@event.listens_for(Simulation, "before_update")
def sim_hashing(mapper, connection: sqlalchemy.Connection, target: Simulation):
    _ = mapper
    _ = connection
    target.encode = target.hashing()


class SuperSimulation(SQLModel, table=True, extend_existing=True):
    """SuperSimulation 回测"""

    id: int | None = Field(default=None, primary_key=True)
    encode: str | None = Field(default=None, unique=True)
    update_time: datetime = Field(default_factory=datetime.now)

    simid: str | None = Field(default=None)
    alpha_id: str = Field(foreign_key="superalpha.id", default=None, nullable=False)

    combo: str
    selection: str

    instrument: str = "EQUITY"
    region: str
    universe: str
    decay: int = Field(ge=0, default=4)
    delay: int = Field(ge=0, le=1)
    neutralization: str = "NONE"
    truncation: float = Field(ge=0, le=1, default=0.08)
    pasteurization: str = "ON"
    unit_handling: str = "VERIFY"
    max_trade: str = "OFF"
    language: str = "FASTEXPR"
    nan_handling: str = "ON"
    visualization: bool = False
    selection_limit: int = Field(ge=10, default=10)
    selection_handling: str = "POSITIVE"
    component_activation: str = "IS"

    name: str | None = None
    favorite: bool = False
    hidden: bool = False
    color: str | None = None
    category: str | None = None
    tags: list[str] = Field(default_factory=list, sa_column=sqlalchemy.Column(JSON))
    selection_description: str | None = None
    combo_description: str | None = None

    def to_payload(
        self, mode: Literal["description", "simulation"] = "simulation"
    ) -> dict:
        match mode:
            case "simulation":
                return {
                    "type": "SUPER",
                    "settings": {
                        "maxTrade": self.max_trade,
                        "nanHandling": self.nan_handling,
                        "instrumentType": self.instrument,
                        "delay": self.delay,
                        "universe": self.universe,
                        "truncation": self.truncation,
                        "unitHandling": self.unit_handling,
                        "selectionLimit": self.selection_limit,
                        "selectionHandling": self.selection_handling,
                        "componentActivation": self.component_activation,
                        "pasteurization": self.pasteurization,
                        "region": self.region,
                        "language": self.language,
                        "decay": self.decay,
                        "neutralization": self.neutralization,
                        "visualization": self.visualization,
                    },
                    "combo": self.combo,
                    "selection": self.selection,
                }
            case "description":
                return {
                    "name": self.name,
                    "color": self.color,
                    "tags": self.tags,
                    "category": self.category,
                    "regular": {"description": None},
                    "combo": {"description": self.combo_description},
                    "selection": {"description": self.selection_description},
                    "favorite": self.favorite,
                }
            case _:
                raise ValueError(f"不支持的 Payload 模式: {mode}")

    def hashing(self) -> str:
        fields = [
            self.combo,
            self.selection,
            self.region,
            self.universe,
            self.instrument,
            self.delay,
            self.decay,
            self.neutralization,
            self.truncation,
            self.pasteurization,
            self.unit_handling,
            self.nan_handling,
            self.max_trade,
            self.visualization,
            self.language,
            self.selection_limit,
            self.selection_handling,
            self.component_activation,
        ]
        return hashing_fields(fields=fields)


